// Use it in instead of the image location to source.
import { ReactComponent as ReactLogo } from "./images/main_logo.svg"

function Header() {
    return (
        <div className="header">
            <img src="./main_logo.svg"/>
            <ul className="nav">
                <li>Pricing</li>
                <li>About</li>
                <li>Content</li>
            </ul>
        </div>
    );
}

export default Header;
